import React from "react";
import styled from "styled-components";

const Contacts = () => {

    return (
        <ContactsContainer>
            <Iphone>
                <StatusBar>
                    <span className="primaryButtonText">9:41</span>
                    <span>
                        <img src="/iPhoneImage/Wifi.svg" alt="wi-fi"></img>
                        <img></img>
                    </span>
                </StatusBar>
            </Iphone>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 70%;
    height: 100vh;
    margin: 90px auto;
    align-items: center;
    display: flexbox;
`

const Iphone = styled.div`
    width: 437px;
    height: 882px;
    margin: 0px auto;
    background-image: url(/iPhoneImage/iPhoneImage.svg);
`

const StatusBar = styled.div`
    width: 90%;
    height: 47px;
    margin: 1.5em auto;
`

export default Contacts;
